import React from 'react';
import './RecValue.css';

const RecValue = props => {
    function renderData() {
        return (

        <table>
            <thead>
                <th>Ingredients</th>
                <th>Value</th>
            </thead>


                <tbody>
        { props.concepts.map(item => (
    <tr key={item.id}>
        <td>{item.name}</td>
        <td>{item.value}</td>
    </tr>

    
        )

    )

}               
                </tbody>
        </table>
            
        )
        
    }

}

export default RecValue;
